import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import classNames from "classnames";
import GridContainer from "components/Grid/GridContainer.jsx";
import GridItem from "components/Grid/GridItem.jsx";
import HeaderLinks from "components/Header/HeaderLinks.jsx";
import NavPills from "components/NavPills/NavPills.jsx";
import Parallax from "components/Parallax/Parallax.jsx";
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import ListSubheader from '@material-ui/core/ListSubheader';

const styles = theme => ({
  root: {
    width: '100%',
    // maxWidth: 360,
    backgroundColor: theme.palette.background.paper,
    position: 'relative',
    overflow: 'auto',
    maxHeight: 500,
  },
  listSection: {
    backgroundColor: 'inherit',
  },
  ul: {
    backgroundColor: 'inherit',
    padding: 0,
  },
});

class TableStats extends React.Component {
  render() {
    const { classes, ...rest } = this.props;
    const imageClasses = classNames(
      classes.imgRaised,
      classes.imgRoundedCircle,
      classes.imgFluid
    );
    const navImageClasses = classNames(classes.imgRounded, classes.imgGallery);

    return (
      <GridItem>
        <div className={classes.root} >
          <h4 className={classes.title}>Tyre Model :  </h4>
          <h5 style={{ display: "inline", paddingLeft: '10px' }}>  BCVHGU1278391734</h5>
        </div>
        <div className={classes.typo} >
          <h4 className={classes.title}>Carbon Used :  </h4>
          <h5 style={{ display: "inline" }}>  Premium Quality</h5>
        </div>

        <div className={classes.typo} >
          <h4 className={classes.title}>Tire Size :  </h4>
          <h5 style={{ display: "inline" }}>  21 Inches</h5>
        </div>

        <div className={classes.typo} >
          <h4 className={classes.title}>Axis Size : </h4>
          <h5 style={{ display: "inline" }}>  12 inches</h5>
        </div>

        <div className={classes.typo} >
          <h4 className={classes.title}>Axis Size : </h4>
          <h5 style={{ display: "inline" }}>  12 inches</h5>
        </div>

        <h4 className={classes.title}>Axis Alignment :</h4>

      </GridItem>
    );
  }
}



export default withStyles(styles)(TableStats);
